            <h3>${price} <span>/per person</span></h3>
                <span className="tour__rating d-flex align-items-center gap-1">
                    <i class="ri-star-fill" 
                    style={{'color':'var(--secondary-color)'}}></i> 
                    {avgRating === 0 ? null : avgRating}
                    {totalRating === 0 ? (
                    "Not Rated"
                    ) : (
                    <span>({reviews?.length})</span>
                    )}
                </span>
        </div>
    </div>
  )
}

